import logo from './logo.svg';
import './App.css';
import { Configuration,OpenAIApi } from 'openai';

function App() {
  const configuration = new Configuration({
    organization: "org-W4Imdx1jPxZeDs6nR6rBma7C",
    apiKey: "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",
  });
  const connection = new OpenAIApi(configuration);
  const response = connection.listEngines();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <button onClick={()=>{
          console.log({response})
        }}>
        click
        </button>
      </header>
    </div>
  );
}

export default App;
